measurements.description:
Three full flowers on one upright 14-cm inflorescence;

	 sepals lavender;
	 petals full, crossing, ruffled edges, medium-dark lavender, white centrally proximally;
	 lip frilly, dark lavender edges, dark lavender veins, yellow proximally, overlaid partially dark lavender veins;
	 column white, dark lavender marks, anther cap white;
	 substance firm; texture slightly crystalline.
